import './App.css';
import Card from './card';
function App() {
  const items = [
    { title: "Game", desc: "A fun activity to play" },
    { title: "Book", desc: "A source of knowledge" },
    { title: "Movie", desc: "An entertaining film" },
    { title: "Music", desc: "A collection of sounds" }
  ];

  console.log(items);

  return (
    <div className="App">
    <div className="App-header">
      <div>
        items.map((data)=>{<Card title={data.title} desc="dsafasfasd"/>})

      </div> 
    </div>
    </div>
  );
}

export default App;
